body.query:
    fragment ticker on Pair {
      id,
      base: token0 {
        id
        symbol
        name
      }
      quote: token1 {
        id
        symbol,
        name
      }
      close: token1Price,
      baseVolume: volumeToken0,
      quoteVolume: volumeToken1
    }


{
  pairs(
    first: 1000,
    orderBy: trackedReserveETH,
    orderDirection: desc
  ) {
    ...ticker
  }
}

{
  blocks(
    first: 1,
    orderBy: timestamp,
    orderDirection: desc,
    where: {
      timestamp_gt: 1608118407,
      timestamp_lt: 1608119007
    }
  ) {
    number,
    timestamp
  }
}

